import React from 'react';

import { stySelect } from './styles';

const Dropdown = () => {
  return (
    <div>
      <select className={stySelect}>
          <option value="option 1">Option 1</option> 
        <option value="option 2">Option 2</option>
      </select>
    </div>
  );
};

export default Dropdown;
